import React,{Component} from "react";

export default class PersonForm3 extends Component{
    state={
        name:"",
        age:0,
        mobile:0,
    }
    onInptChange=(event)=>{
       this.setState({[event.target.name]:event.target.value}) 
    }

  render(){
      return(
          <>
          <h1>MY FORM</h1>
          <form>
          <label>Name:</label>
          <input name={"name"} value={this.state.name} onChange={this.onInptChange}></input>
          <br/>
          <label>Age:</label>
          <input name={"age"} value={this.state.age} onChange={this.onInptChange}></input>
          <br/>
          <label>Mobile:</label>
          <input name={"mobile"} value={this.state.mobile} onChange={this.onInptChange}></input>
          <br/>
         <button>Submit</button>
         </form>
          </>
      )
  }
}
